import React from "react";
import "./App.css";
import logo from "./assets/singulAI-logo.png";

function App() {
  return (
    <div className="container">
      <img src={logo} alt="SingulAI Logo" />
      <h1>Legado Digital</h1>
      <p>Bem-vindo ao projeto!</p>
      <input type="text" placeholder="Digite sua carteira" />
      <button>Entrar</button>
    </div>
  );
}

export default App;
